import AddUser from './AddUser';
import AddExercise from './AddExercise';
import './App.css';

function App() {
  return (
    <div className="container">
      <h1>Food Options</h1>
      <div className="section">
        <h2>Add a User</h2>
        <AddUser />
      </div>
      <div className="section">
        <h2>Add an Exercise</h2>
        <AddExercise />
      </div>
    </div>
  );
}

export default App;
